import MovieCard from './MovieCard';

const MoviesContainer = ({ movies }) => {
  return (
    <div className='row'>
      {movies.map(movie => {
        return <MovieCard movie={movie} key={movie.id} />;
      })}
    </div>
  );
};

export default MoviesContainer;
